css:
kite-open-link {
  display: block;
  text-align: right;
}
kite-open-link a {
  display: inline-block;
  transition: 125ms opacity;
  margin-right: 0.5em;
}
kite-open-link a,
kite-open-link a:active,
kite-open-link a:focus,
kite-open-link a:visited {
  color: #6494ed;
  text-decoration: none;
}
kite-open-link a span,
kite-open-link a:active span,
kite-open-link a:focus span,
kite-open-link a:visited span {
  color: #9da5b4;
  opacity: 0.6;
}
kite-open-link a:hover,
kite-open-link a:active:hover,
kite-open-link a:focus:hover,
kite-open-link a:visited:hover {
  text-decoration: underline;
}
kite-open-link a:hover span,
kite-open-link a:active:hover span,
kite-open-link a:focus:hover span,
kite-open-link a:visited:hover span {
  text-decoration: none;
  opacity: 1;
}
kite-open-link a > * {
  pointer-events: none;
}
kite-open-link a i {
  font-style: normal;
  font-weight: normal;
}
kite-open-link a span {
  background-color: rgba(49, 54, 63, 0.995);
  padding: 0.25em 0.5em;
  border-radius: 0.25em;
}
kite-open-link a span i,
kite-open-link a span kbd {
  display: inline-block;
  vertical-align: middle;
}
kite-open-link a kbd {
  font-size: 1.2em;
  font-weight: lighter;
  font-family: 'BlinkMacSystemFont', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  margin-left: 0.5em;
  background-color: transparent;
  padding: 0;
}
kite-open-link a span,
kite-open-link a kite-logo {
  vertical-align: middle;
  display: inline-block;
}
kite-open-link kite-logo {
  display: inline-block;
  opacity: 0.5;
}
kite-open-link kite-logo svg {
  width: 1.2em;
}
kite-open-link kite-logo svg polygon {
  fill: #d7dae0;
}
